import React, {useState, useEffect} from "react";
import axios from 'axios';


function DataFetching(){
    const [latest, setLatest]= useState([])

    useEffect( () => {
       axios.get('http://3.134.99.170:4000/latest')
       .then (res =>{
         console.log(res)
         setLatest(res.data)
       });
    }, []);
    return(
        <div>
            <ul>
            {latest.map((latest) => {
                return <li key = {latest.id}>{latest.name}</li>
               })
               
               }
            </ul>
        </div>
    )
}
export default DataFetching;
